{'Table': '{\'col_1\': \'CleanVideoInvite a Monarch to Lunch - the Biology and Ecology of the Monarch Butterfly\', \'description\': \'Pollinators have been in the news lately because of the dramatic drop in the numbers scientists and citizens have observed and reported data on for the last few years from some very interesting Citizen Science projects. Monarchs are an iconic and well-loved species, the state insect of seven different states. The monarch is the only butterfly to make a two-way migration such as birds do. Currently, the migration is listed as "an endangered natural phenomena". Our speaker Trecia Neal, Biologist and Monarch Conservation Specialist at Fernbank Science Center, will discuss the biology and ecology of the monarch, why the migration is endangered, as well as current conservation efforts and how you can help. She will have handouts for you to take home and live monarchs and milkweed available to observe. About our speaker Trecia Neal has been a biologist at Fernbank Science Center since 1990. Trecia\\\'s areas of expertise are ornithology, environmental education, and establishing outdoor classrooms and gardens at schools. For the last ten years, she has been teaching students and teachers about the wonders of monarchs by teaching Professional Development courses in Michoacan, Mexico to study the biology and ecology of the Monarch butterfly in its overwintering habitat. Since returning from Mexico the first year, she has been busy spreading the word about monarchs across the state. Trecia has a bachelor\\\'s and master\\\'s degree in biology with an emphasis in animal behavior and science education. Trecia has also worked to advise former First Lady Rosalyn Carter on what was needed to make her butterfly gardens best suitable for monarchs and help them get Waystation certified.\'}\n{\'col_1\': \'CleanThe Science of Beer\', \'description\': \'SPECIAL EDITION! We are pleased to have Jacob Shreckengost, a graduate student in the Neuroscience Program at Emory University and an avid beer enthusiast as well as an amateur brewer, as our featured speaker for the evening. Jacob will tell us, from a scientific perspective, what makes beer beer and, drawing on his research interests, why the probably the oldest alcoholic beverage in the world appeals so much to us. --- Released and distributed under the Creative Commons BY-NC-SA 3.0 United States license http://creativecommons.org/licenses/by-nc-sa/3.0/us/ You are free to: Share - to copy, distribute and transmit the work Remix - to adapt the work Under the following conditions: Attribution - You must attribute the work (but not in any way that suggests that the Atlanta Science Tavern nor AbruptMedia, LLC endorses you or your use of the work) to the Atlanta Science Tavern (http://www.AtlantaScienceTavern.com) and AbruptMedia, LLC (http://www.AbruptMedia.com). Noncommercial - You may not use this work for commercial purposes. Share Alike - If you alter, transform, or build upon this work, you may distribute the resulting work only under the same or similar license to this one.\'}\n{\'col_1\': \'CleanLife Traces of the Georgia Coast\', \'description\': \'Dr. Tony Martin will provide us with an introduction to the tracks, trails, burrows, and other traces that life leaves in the sands and muds of the Georgia barrier islands, as illustrated by real-life examples. These traces not only tell us interesting stories about the animals that make them, but can be used to better interpret animal behavior and ecology, while also providing insights into evolution and the fossil record. Anthony (Tony) Martin was born in Terre Haute, Indiana, and as a child he loved learning about insects, dinosaurs, and natural history. His Ph.D. is in geology from the University of Georgia, and he is a Professor of Practice in the Department of Environmental Studies at Emory University (Atlanta, Georgia), where he has taught for 20 years. His primary research interest is ichnology, the study of organismal traces and trace fossils. He has authored many papers on a wide variety of geological and paleontological subjects, and delivered more than a hundred academic and public lectures on the ichnology of modern and ancient environments. He is the author of the textbook "Introduction to the Study of Dinosaurs", a field guidebook to the trace fossils of San Salvador Island (Bahamas), a recent short book about the first known burrowing dinosaur, and is currently finishing a book titled Life Traces of the Georgia Coast through Indiana University Press. [ This is a highly visual presentation; however, Dr. Martin\\\'s slide presentation is not available for redistribution because it will be used in his soon to be released book. ]\'}\n{\'col_1\': \'CleanVideoThe Moon and Mercury: Water, Water Everywhere?\', \'description\': "Thom Orlando and Gregory Grieves describe the search for water on the Moon and Mercury and the Lunar Atmosphere and Dust Environment Explorer (LADEE) to be launched next May as well as BepiColombo, ESA\'s first mission to Mercury scheduled for 2015. --- Released and distributed under the Creative Commons BY-NC-SA 3.0 United States license http://creativecommons.org/licenses/by-nc-sa/3.0/us/ You are free to: Share - to copy, distribute and transmit the work Remix - to adapt the work Under the following conditions: Attribution - You must attribute the work (but not in any way that suggests that the Atlanta Science Tavern, Georgia Tech, nor AbruptMedia, LLC endorses you or your use of the work) to the Atlanta Science Tavern (http://www.AtlantaScienceTavern.com) and AbruptMedia, LLC (http://www.AbruptMedia.com). Noncommercial - You may not use this work for commercial purposes. Share Alike - If you alter, transform, or build upon this work, you may distribute the resulting work only under the same or similar license to this one."}', 'Column': 'col_1', 'type': 'name'}

